var Flash2x = (function () {
    var _domain="";
    var _time=new Date().getTime();
    RES.registerAnalyzer("js", F2xJsAnalyzer);
    var Flash2x = {};
    Flash2x._handleCfgComplete = function (e) {
        var s = Flash2x;
        var isHadRES = false;
        for (var i = 0; i < s.loadSceneList.length; i++) {
            if (RES.getGroupByName(s.loadSceneList[i]).length > 0) {
                isHadRES = true;
                RES.loadGroup(s.loadSceneList[i]);
            }
        }
        if (!isHadRES) {
            s._handleComplete(null);
        }
    };
    Flash2x._handleProgress = function (e){
        var s = Flash2x;
        if (s._progressCallback && e.groupName != "RES__CONFIG") {
            var per = (s._loadIndex + (e.itemsLoaded / e.itemsTotal)) / s._loadCount * 100 >> 0;
            s._progressCallback(per, e.itemsLoaded, e.itemsTotal);
        } else {
            s._progressCallback(1);
        }
    };
    Flash2x._handleError = function (e) {
        var s = Flash2x;
        console.warn("" + e.groupName + ",");
    };
    Flash2x._handleItemError = function (e) {
        var s = Flash2x;
        console.warn(+e.resItem.url + "");
    };
    Flash2x._handleComplete = function (e) {
        var s = Flash2x;
        //JSON
        s._loadIndex++;
        if (s._loadIndex == s._loadCount) {
            s._loadState = 0;
            if (s._completeCallback) {
                s._completeCallback();
            }
            RES.removeEventListener(RES.ResourceEvent.CONFIG_COMPLETE, Flash2x._handleCfgComplete.bind(Flash2x), Flash2x);
            RES.removeEventListener(RES.ResourceEvent.GROUP_PROGRESS, Flash2x._handleProgress.bind(Flash2x), Flash2x);
            RES.removeEventListener(RES.ResourceEvent.GROUP_COMPLETE, Flash2x._handleComplete.bind(Flash2x), Flash2x);
            RES.removeEventListener(RES.ResourceEvent.GROUP_LOAD_ERROR, Flash2x._handleError.bind(Flash2x), Flash2x);
            RES.removeEventListener(RES.ResourceEvent.ITEM_LOAD_ERROR, Flash2x._handleItemError.bind(Flash2x), Flash2x);
        }
    };
    Flash2x.loadScene = function (sceneName, progress, complete,domain) {
        var s = Flash2x;
        if (s._loadState > 0) {
            console.warn(",");
            return;
        }
        s.loadCfgList = new Array();
        s.loadSceneList = new Array();
        s._loadCount = 0;
        s._loadIndex = 0;
        s._loadState = 0;
        s._loadSceneResList = [];
        s._completeCallback = null;
        s._progressCallback = null;
        if(domain==undefined){
            domain="";
        }
        _domain=domain;
        if (typeof sceneName == "string") {
            if (!RES.isGroupLoaded(sceneName)) {
                s._loadCount = 1;
                s.loadCfgList.push(domain+"resource/" + sceneName + "/" + sceneName + ".res.json?t="+_time);
                s.loadSceneList.push(sceneName);
            }
        }
        else {
            var len = sceneName.length;
            for (var i = 0; i < len; i++) {
                if (!RES.isGroupLoaded(sceneName[i])) {
                    s._loadCount++;
                    s.loadCfgList.push(_domain+"resource/" + sceneName[i] + "/" + sceneName[i] + ".res.json?t="+_time);
                    s.loadSceneList.push(sceneName[i]);
                }
            }
        }
        if (s._loadCount == 0) {
            if (complete) {
                complete();
            }
            return;
        }
        s._loadState++;
        s._completeCallback = complete;
        s._progressCallback = progress;
        RES.addEventListener(RES.ResourceEvent.CONFIG_COMPLETE, Flash2x._handleCfgComplete.bind(Flash2x), Flash2x);
        RES.addEventListener(RES.ResourceEvent.GROUP_PROGRESS, Flash2x._handleProgress.bind(Flash2x), Flash2x);
        RES.addEventListener(RES.ResourceEvent.GROUP_COMPLETE, Flash2x._handleComplete.bind(Flash2x), Flash2x);
        RES.addEventListener(RES.ResourceEvent.GROUP_LOAD_ERROR, Flash2x._handleError.bind(Flash2x), Flash2x);
        for (var i = 0; i < s.loadCfgList.length; i++) {
            RES.loadConfig(s.loadCfgList[i],_domain);
        }
    };
    Flash2x.getTextureByName = function (scene, imageId) {
        var texture = RES.getRes(scene + "_" + imageId);
        return texture;
    };
    Flash2x.getSoundByName = function (scene, imageId) {
        var sound = RES.getRes(scene + "_" + imageId);
        return sound;
    };
    Flash2x.removeSceneResource = function (sceneName) {
        RES.destroyRes(sceneName);
        var scene = eval(sceneName);
        for (var i in scene) {
            delete scene[i];
        }
        eval(sceneName + "=null;");
    }
    Flash2x.initViewSize=function(){
        var _canvas = document.querySelector(".egret-player").querySelector("canvas");
        Flash2x.devicePixelRatio=_canvas.width/parseInt(_canvas.style.width);
        var divStyle=document.querySelector(".egret-player").style;
        divStyle.position="absolute";
        divStyle.height=window.innerHeight+"px";
        divStyle.width=window.innerWidth+"px";
        divStyle.margin=0;
        divStyle.border=0;
        divStyle.left=0;
        divStyle.top=0;
    }
    Flash2x.setDisplayInfo = function (obj, x, y, alpha, scaleX, scaleY, rotation, skewX, skewY) {
        if (x == undefined)
            x = 0;
        if (y == undefined)
            y = 0;
        if (scaleX == undefined)
            scaleX = 1;
        if (scaleY == undefined)
            scaleY = 1;
        if (rotation == undefined)
            rotation = 0;
        if (skewX == undefined)
            skewX = 0;
        if (skewY == undefined)
            skewY = 0;
        if (alpha == undefined)
            alpha = 1;
        obj.x = x;
        obj.y = y;
        obj.scaleX = scaleX;
        obj.scaleY = scaleY;
        obj.rotation = rotation;
        obj.skewX = skewX;
        obj.skewY = skewY;
        obj.alpha = alpha;
    };
    Flash2x.loadCfgList = null;
    Flash2x.loadSceneList = null;
    Flash2x._loadCount = 0;
    Flash2x._loadIndex = 0;
    Flash2x._loadState = 0;
    Flash2x._loadSceneResList = [];
    Flash2x._completeCallback = null;
    Flash2x._progressCallback = null;
    Flash2x.devicePixelRatio=1;
    Flash2x.globalDispatcher = new egret.EventDispatcher();
    return Flash2x;
})();
